import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Home from './home';

export default function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          <Route exact path="/home" component={Home} />

        </Switch>
      </BrowserRouter>
    </div>
  );
}
